import { List, Card } from 'antd';
import MyLayout from '../homeLayout/myLayout'

const MyList = (props) => {
    const data = [
        {
            title: 'Title 1',
        },
        {
            title: 'Title 2',
        },
        {
            title: 'Title 3',
        },
        {
            title: 'Title 4',
        },
        {
            title: 'Title 5',
        },
        {
            title: 'Title 6',
        },
    ];
    console.log(props);
    return (
        <MyLayout>
            <ul>
                {
                    props.shows.data.list.map((ele) => {
                        return (
                            <li>{ele.ironDir}</li>
                        )
                    })
                }
            </ul>
            <List
                grid={{
                    gutter: 16,
                    xs: 1,
                    sm: 2,
                    md: 4,
                    lg: 4,
                    xl: 6,
                    xxl: 3,
                }}
                dataSource={data}
                renderItem={item => (
                    <List.Item>
                        <Card title={item.title}>Card content</Card>
                    </List.Item>
                )}
            />
        </MyLayout>
    )
}

List.getInitialProps = async function () {
    const res = await fetch('https://worker-api.wanshifu.com/master/listinfo');
    const data = await res.json();
    return {
        shows: data
    }
}

export default MyList
